import Link from 'next/link';

function Footer() {
    return (
        <div className="footer">
            <ul>
                {[1, 2].map((li, i) => <li key={i}>{li}</li>)}
            </ul>
            <ul>
                {[
                    ['Home', '/'], ['About', '/about'], ['Join Us', '/about/join'], ['Staff/Contact', '/about/staff-contact'], ['Legal Notices', 'about/legal-notices'], ['FAQ', '/faq'], ['Advertising', '/advertising']
                ].map(([title, route], i) => <li key={i}><Link href={route}><a>{title}</a></Link></li>)
                }
            </ul>
            <img src="https://pixel.wp.com/g.gif?v=ext&j=1%3A8.1.1&blog=32043259&post=0&tz=-7&srv=dailynexus.com&host=dailynexus.com&ref=https%3A%2F%2Fdailynexus.com%2Faboutcontact%2F&fcp=0&rand=0.4052728025036777" alt="smile!" />

            <style jsx>{`
                .footer {
                    display: flex;
                    flex-direction: column;
                    justify-content: center;
                    align-items: center;
                }

                ul {
                    display: flex;
                }

                li {
                    margin: .5rem;
                }

                a {
                    color: black;
                }
            `}</style>
        </div>
    )
}

export default Footer
